import { StyleSheet } from "react-native";

const estilo = StyleSheet.create({
  fundo: {
    width: '100%', 
    height: "100%", 
    backgroundColor:"rgb(255,249,215)",
    flex: 1,
    justifyContent: 'flex-end',
    alignItems: "center"
  },
  boxBotaoTabuada: {
    width: 180,
    marginBottom: 10
  }
});

export default estilo;
